import React from "react";

const imgUrl = '/assets/images/skills-bg.jpg';

const style = {
        aboutSection: {
            background: "#00BCD4",
            minHeight: "100vh"
        },
        mainRow: {
            paddingTop: "2px",
            background: "#00BCD4"
        },
        billBrasherImg: {
            width: "250px"
        },
        imgDiv: {
            display: "flex",
            justifyContent: "center",
            alignContent: "center",
            alignItems: "center",
            background: "#FAFAFA"
        },
        aboutDiv: {
            textAlign: "justify",
            display: "flex",
            justifyContent: "center",
            paddingTop: "20px",
            fontSize: "20px",
            background: "#FAFAFA"
        },
        skills: {
            display: "flex",
            justifyContent: "center",
            backgroundImage: 'url(' + imgUrl + ')',
            backgroundSize: 'cover'
        },
        skillImgs: {
            display: "flex",
            justifyContent: "space-around",
            padding: "10px 50px 10px 50px",
            overflow: "auto",
            backgroundImage: 'url(' + imgUrl + ')',
            backgroundSize: 'cover',
            overflow: 'hidden'
        },
        header: {
            textShadow: "2px 2px #999"
        },
        p: {
            paddingRight: "10px",
            maxWidth: "520px"
        }
};

const AboutMe = props => (
        <div id="about-me" style={style.aboutSection}>
                <div className="col-md-12">
                        <div style={style.mainRow} className="row">
                                <div id="aboutDiv" style={style.aboutDiv} className="col-md-4">
                                        <div>
                                                <h6 id="my-story"><strong>MY STORY</strong></h6>
                                                        <p style={style.p}>
                                                                Lorem ipsum lorem ipsum
                                                                lorem ipsum ipso facto
                                                                lorem facto ipsum dei. 
                                                        </p>
                                        </div>
                                </div>

                                <div id="imgDiv" style={style.imgDiv} className="col-md-4">
                                        <div>
                                                <img 
                                                        alt="Bill Brasher"
                                                        src="assets/images/portrait.png"
                                                        style={style.billBrasherImg}
                                                />
                                        </div>
                                </div>

                        </div>
                        <div className="row">
                                <div style={style.skills} className="col-md-12">
                                        <h2 style={style.header}>My Skills</h2>
                                </div>
                                <div style={style.skillImgs} className="col-md-12">
                                        <div className="row">{props.children}</div>
                                </div>
                        </div>
                </div>
        </div>

);

export default AboutMe;
